import React from 'react'
import { Link } from 'react-router-dom';
import Frame from './assets/Frame.svg';
import './Header.css';

const Header = () => {
    return (
        <header className='header'>
            <div>
                <h1>
                    <Link to="/" className='logo'>
                        <img src={Frame} alt="" />
                    </Link>
                </h1>
            </div>
        </header>
    )
}

export default Header
